[{"location":"#PenultimateDays.jl-Documentation","page":"Index","title":"PenultimateDays.jl Documentation","text":"","category":"section"},{"location":"","page":"Index","title":"Index","text":"","category":"page"},{"location":"","page":"Index","title":"Index","text":"CurrentModule = PenultimateDays\nDocTestSetup = quote\n    using PenultimateDays\nend","category":"page"},{"location":"#Adding-PenultimateDays.jl","page":"Index","title":"Adding PenultimateDays.jl","text":"","category":"section"},{"location":"","page":"Index","title":"Index","text":"using Pkg\nPkg.add(\"PenultimateDays\")","category":"page"},{"location":"#Documentation","page":"Index","title":"Documentation","text":"","category":"section"},{"location":"#Trivial-Penultimate-Functions","page":"Index","title":"Trivial Penultimate Functions","text":"","category":"section"},{"location":"","page":"Index","title":"Index","text":"penultimatedayofweek(::TimeType)\npenultimatedayofmonth(::TimeType)\npenultimatedayofquarter(::TimeType)\npenultimatedayofyear(::TimeType)","category":"page"},{"location":"#Main.PenultimateDays.penultimatedayofweek-Tuple{Dates.TimeType}","page":"Index","title":"Main.PenultimateDays.penultimatedayofweek","text":"penultimatedayofweek(dt::TimeType) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its week.\n\n\n\n\n\n","category":"method"},{"location":"#Main.PenultimateDays.penultimatedayofmonth-Tuple{Dates.TimeType}","page":"Index","title":"Main.PenultimateDays.penultimatedayofmonth","text":"penultimatedayofmonth(dt::TimeType) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its month.\n\n\n\n\n\n","category":"method"},{"location":"#Main.PenultimateDays.penultimatedayofquarter-Tuple{Dates.TimeType}","page":"Index","title":"Main.PenultimateDays.penultimatedayofquarter","text":"penultimatedayofquarter(dt::TimeType) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its quarter.\n\n\n\n\n\n","category":"method"},{"location":"#Main.PenultimateDays.penultimatedayofyear-Tuple{Dates.TimeType}","page":"Index","title":"Main.PenultimateDays.penultimatedayofyear","text":"penultimatedayofyear(dt::TimeType) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its year.\n\n\n\n\n\n","category":"method"},{"location":"#Day-specific-Penultimate-Functions","page":"Index","title":"Day-specific Penultimate Functions","text":"","category":"section"},{"location":"","page":"Index","title":"Index","text":"penultimatedayofmonth(::TimeType, ::Int)\npenultimatedayofquarter(::TimeType, ::Int)\npenultimatedayofyear(::TimeType, ::Int)","category":"page"},{"location":"#Main.PenultimateDays.penultimatedayofmonth-Tuple{Dates.TimeType, Int64}","page":"Index","title":"Main.PenultimateDays.penultimatedayofmonth","text":"penultimatedayofmonth(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its month, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the penultimatedayofmonth(dt, 6) will find the penultimate Saturday of the month.  Dates also exports integer aliases Monday–Sunday, so you can write penultimatedayofmonth(dt, Saturday).\n\nSee also: Dates.dayofweek, lastdayofmonth\n\n\n\n\n\n","category":"method"},{"location":"#Main.PenultimateDays.penultimatedayofquarter-Tuple{Dates.TimeType, Int64}","page":"Index","title":"Main.PenultimateDays.penultimatedayofquarter","text":"penultimatedayofquarter(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its quarter, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the penultimatedayofquarter(dt, 6) will find the penultimate Saturday of the quarter.  Dates also exports integer aliases Monday–Sunday, so you can write penultimatedayofquarter(dt, Saturday).\n\nSee also: Dates.dayofweek, lastdayofquarter\n\n\n\n\n\n","category":"method"},{"location":"#Main.PenultimateDays.penultimatedayofyear-Tuple{Dates.TimeType, Int64}","page":"Index","title":"Main.PenultimateDays.penultimatedayofyear","text":"penultimatedayofyear(dt::TimeType, d::Int) -> TimeType\n\nAdjusts dt to the penultimate (second-to-last) day of its year, given some d, the day of the week as an Int, with 1 = Monday, 2 = Tuesday, &c...\n\nFor example, the penultimatedayofyear(dt, 6) will find the penultimate Saturday of the year.  Dates also exports integer aliases Monday–Sunday, so you can write penultimatedayofyear(dt, Saturday).\n\nSee also: Dates.dayofweek, lastdayofyear\n\n\n\n\n\n","category":"method"},{"location":"#Dates-(Standard-Library)-Extended","page":"Index","title":"Dates (Standard Library) Extended","text":"","category":"section"},{"location":"","page":"Index","title":"Index","text":"firstdayofweek(::TimeType, ::Int)\nlastdayofweek(::TimeType, ::Int)\nfirstdayofmonth(::TimeType, ::Int)\nlastdayofmonth(::TimeType, ::Int)\nfirstdayofquarter(::TimeType, ::Int)\nlastdayofquarter(::TimeType, ::Int)\nfirstdayofyear(::TimeType, ::Int)\nlastdayofyear(::TimeType, ::Int)","category":"page"},{"location":"#Index","page":"Index","title":"Index","text":"","category":"section"},{"location":"","page":"Index","title":"Index","text":"","category":"page"}]
